import TodoList from "./TodoList";
import {useDespatch} from 'rea'
const TodoForm = () => {
  return (
    <>
      <div>
        <input type='text' onChange={e => props.setText(e.target.value)} />
        <input type='submit' onClick={props.addTodo} />
        <input type="button" value="delete" onClick={()=>props.btnDelete()}/>
      </div>
      <TodoList check={props.check}/>
    </>
  );
}

export default TodoForm
